import React from "react";
import "./Contact.css";

function Contact() {
    state = {
        email: {
            firstName: "",
            lastName: "",
            phoneNumber: "",
            email: "",
            message: ""
        }
    }

    sendEmail = _ => {
        const { email } = this.state;
        fetch(`http://localhost:8000/send-email?firstName-${email.firstName}&lastName-${email.lastName}&phoneNumber-${email.phoneNumber}&email-${email.email}&message-${email.message}`)
        .catch(err => console.log(err));
    }

    return (
        <div className="contact">
            <h1>Contact Us</h1>
            <div className="contact-container">
                <form>
                    <input className="input-box" placeholder="First Name" type="text" />
                    <input className="input-box" placeholder="Last Name" type="text" />
                    <input className="input-box" placeholder="Phone Number" type="text" />
                    <input className="input-box" placeholder="Email" type="text" />
                    <textarea className="message-box" placeholder="Message" type="text" />
                    <button className="submit-btn" type="submit" value="submit">Submit</button>
                </form>
                <img className="map" src="images/map.png" alt="" />
            </div>
        </div>
    )
}

export default Contact;
